oordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"3334","type":"BoxAnnotation"},{"attributes":{"line_color":"#df0000","line_dash":[0,0],"line_width":2,"x":{"field":"year"},"y":{"field":"Volume (% 2022)"}},"id":"3530","type":"Line"},{"attributes":{"css_classes":["markdown"],"margin":[5,5,5,5],"name":"Markdown133520","text":"&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;color:#326a86;font-size:15px&amp;quot;&amp;gt;Diese interaktive Graphik zeigt die vorraussichtlichen relativen Gletschervolumen\u00e4nderungen (in % zu 2022) der Europ\u00e4ischen Alpen f\u00fcr vier verschiedene &amp;lt;a href=&amp;quot;https://www.dkrz.de/de/kommunikation/klimasimulationen/cmip6-de/die-ssp-szenarien?set_language=de&amp;quot;&amp;gt;SSP-Szenarien&amp;lt;/a&amp;gt; zwischen 2022 und 2100. Hierbei ist SSP1-2.6 ein relativ optimistisches Szenario (niedrige Treibhausgasemissionen) mit einer globalen mittleren Erw\u00e4rmung von \u0394T~+1.8\u00b0C bis 2100 (relativ zu 1850-1900 berechnet). Das Szenario SSP5-8.5 ist das pessimistischste (sehr hohe Treibhausgasemissionen, im Mittel \u0394T~+4.5\u00b0C). Auch die Entwicklung der Gletscher f\u00fcr verschiedene Regionen der Welt k\u00f6nnen verglichen werden. Hierbei ist ebenfalls das Referenzvolumen das der Gletscher von 2022, jedoch f\u00fcr die jeweilige Region. Wir zeigen jeweils den &amp;lt;a href=&amp;quot;https://de.wikipedia.org/wiki/Median&amp;quot;&amp;gt;Median&amp;lt;/a&amp;gt; und den unteren und oberen Teil des &amp;lt;a href=&amp;quot;https://de.wikipedia.org/wiki/Konfidenzintervall&amp;quot;&amp;gt;95% Konfidenz-Intervalls&amp;lt;/a&amp;gt;, was die Unsicherheiten von Klimamodellen repr\u00e4sentiert.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;"},"id":"3300","type":"panel.models.markup.HTML"},{"attributes":{"source":{"id":"3531"}},"id
